import React from 'react';

class Login extends React.Component {

    constructor(props){
        super(props);
        
    }

    render(){
        return (
            <form>
                <label>
                    Email : 
                   
                    <input type="text" name="email" 
                       
                         />
                </label>
                <label>
                    Password : 
              
                    <input type="text" name="password"
                        
                        />
                </label>
                <input type="submit" value="Login" />
            </form>
        );
    }
}

export default Login;
